import * as o from "react";
import n from "../lib/IconBase.es.js";
import a from "../defs/Option.es.js";
const t = o.forwardRef((e, r) => /* @__PURE__ */ o.createElement(n, { ref: r, ...e, weights: a }));
t.displayName = "OptionIcon";
const p = t;
export {
  p as Option,
  t as OptionIcon
};
